import React, { Fragment } from 'react';

const Footer = (props) => (
  <Fragment>
    <div id="Footer">
      Footer
    </div>
    <style jsx>
      {`
        *{
          padding: 0;
          margin: 0;
        }
      `}
    </style>
  </Fragment>
);

export default Footer;
